        <thead>
        <tr>
          <th>Name</th>
          <th>Cuisine</th>
          <th>Photo</th>
          <th>Ingredients</th>
          <th>Preparation</th>
          <th>Actions</th>
        </tr>
        </thead>
        <tbody>
          <RecipeRow recipe={recipe}
                     deleteRecipe={() => deleteRecipe(index)}
                     key={index}/>

        </tbody>
      </table>
    </div>
  );
}

export default RecipeList;
